import React, { Component } from 'react';
import { Tabs, TabLink, TabContent } from 'react-tabs-redux'
import { TeamRankingTable } from './TeamRankingTable'
import { PlayersRankingTable } from './PlayersRankingTable'


const RankingHeader = ( { phase }) => 
	<h1>Après la journée {phase.current_ranking.number} / {phase.journee_last}</h1>


const ByDivisionRanking = ({ divisions }) => {
	const divs = divisions.map( (dv) =>
		<div key={ 'rankingdiv_'+dv['id'] }>
			<h2 className="division-title">{ dv['name'] }</h2>
			<TeamRankingTable teams={ dv['ranking'] } height={ 700 } />
		</div>	
	)  
	return (
			divs
		);
}

class PositionFilter extends Component {

	constructor(props) {
		super(props)
	}

	render() {
		return(
			<form>
			<label>
			Poste: <select onChange={this.props.handleChange} value={this.props.value}>
			<option value=""></option>
			<option value="G">Gardiens</option>
			<option value="D">Défenseurs</option>
			<option value="M">Milieux</option>
			<option value="A">Attaquants</option>
			</select>
			</label>
			</form>
		);
	}
}

class PlayersFilterTable extends Component {

	constructor(props) {
		super(props)

		this.state = {
			filterPosition: 'G'
		}
	}

	render() {
    	return (
    		<div>
			<PositionFilter value={ this.state.filterPosition } handleChange={ ( event ) => this.setState({ filterPosition: event.target.value }) } />
			<PlayersRankingTable players={ PLAYERS } phases={ PHASES } filterPosition={ this.state.filterPosition } height={ 700 }/>
			</div>
		)
	}

}


